import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Header from './components/Header/Header';
import FeedbackLogin from './components/Login/FeedbackLogin';
import FeedbackForm from './components/Feedback/FeedbackForm';
import FeedbackSubmitted from './components/FeedbackSubmitted/FeedbackSubmitted';
import Admin from './components/Admin/Admin';
import AddCourseData from './components/Admin/AddCourseData';
import AddStudentData from './components/Admin/AddStudentData';
import FeedbackViewer from './components/Admin/FeedbackViewer';
import Footer from './components/Footer/Footer'; // Import the Footer component
import './App.css';

function App() {
    return (
        <BrowserRouter
            future={{
                v7_startTransition: true, // Enable startTransition future flag
                v7_relativeSplatPath: true, // Enable relativeSplatPath future flag
            }}
        >
            <div className="app-container">
                <Routes>
                    <Route path="/" element={<FeedbackLogin />} />
                    <Route
                        path="/feedback"
                        element={
                            <>
                                <Header />
                                <FeedbackForm />
                            </>
                        }
                    />
                    <Route
                        path="/feedback-submitted"
                        element={
                            <>
                                <Header />
                                <FeedbackSubmitted />
                            </>
                        }
                    />
                    <Route
                        path="/admin"
                        element={
                            <>
                                <Header />
                                <Admin />
                            </>
                        }
                    />
                    <Route
                        path="/admin/add-courses"
                        element={
                            <>
                                <Header />
                                <AddCourseData />
                            </>
                        }
                    />
                    <Route
                        path="/admin/add-students"
                        element={
                            <>
                                <Header />
                                <AddStudentData />
                            </>
                        }
                    />
                    <Route
                        path="/admin/feedback-viewer"
                        element={
                            <>
                                <Header />
                                <FeedbackViewer />
                            </>
                        }
                    />
                    <Route
                        path="*"
                        element={
                            <>
                                <Header />
                                <div>404 - Page Not Found</div>
                            </>
                        }
                    />
                </Routes>
                <Footer /> {/* Always display the footer */}
            </div>
        </BrowserRouter>
    );
}

export default App;
